import Button from 'react-bootstrap/Button';

function Buttonx() {
  return (
    <>
      <Button variant="dark">Admin</Button>
      <Button variant="dark">Patient</Button>
      <Button variant="dark">Doctor</Button>
    </>
  );
}

export default Buttonx;
